import React, { useState } from 'react';
import { Link, useHistory } from 'react-router-dom';
import './Navbar.css';

function Navbar() {
  const [click, setClick] = useState(false);
  const history = useHistory();

  const handleClick = () => {
    setClick(false);
    window.scrollTo(0, 0);
  };

  const handleDelayedClick = (path) => {
    setTimeout(() => {
      history.push(path);
    }, 5000); // Delay in milliseconds
  };

  return (
    <>
      <nav className='navbar'>
        <div className='navbar-container'>
          <Link to='/' className='navbar-logo' onClick={handleClick}>
            Hub AI
          </Link>

          <ul className={click ? 'nav-menu active' : 'nav-menu'}>
            <li className='nav-item'>
              <Link to='/' className='nav-links' onClick={handleClick}>
                Home
              </Link>
            </li>
            <li className='nav-item'>
              <Link
                to='/support'
                className='nav-links'
                onClick={() => handleDelayedClick('/support')}
              >
                Support
              </Link>
            </li>
            <li className='nav-item'>
              <Link
                to='/learning-hub'
                className='nav-links'
                onClick={() => handleDelayedClick('/learning-hub')}
              >
                Learning Hub
              </Link>
            </li>
            <li className='nav-item'>
              <Link
                to='/library'
                className='nav-links'
                onClick={() => handleDelayedClick('/library')}
              >
                AI Library
              </Link>
            </li>
          </ul>
        </div>
      </nav>
    </>
  );
}

export default Navbar;
